#include <stdio.h>
#include <stddef.h>

typedef struct{
    int index;
    int height;
}Point;

int largestRectangleArea(int* heights, int heightsSize){
    Point heap[10000];
    int heapSize = 0;

    int i,j,height,area,max_area=0;
    for(i=0;i<heightsSize;i++){
        area = height = heights[i];
        if(area > max_area){
            max_area = area;
        }
        for(j=heapSize-1;j>=0;j--){
            if(height > heap[j].height){
                height = heap[j].height;
            }
            area = (i-heap[j].index+1) * height;
            if(area > max_area){
                max_area = area;
            }
        }

        height = heights[i];
        if(heapSize == 0 || height > heap[heapSize-1].height){
            heap[heapSize].index = i;
            heap[heapSize].height = height;
            heapSize++;
        }else{
            for(;heapSize>0 && heap[heapSize-1].height >= height;heapSize--){}
            heap[heapSize++].height = height;
        }
    }
    return max_area;
}

